                <select className='dropdown-buscador' name="localidad">
                    <option value="vicentelopez">Vicente Lopez</option>
                    <option value="sanisidro">San Isidro</option>
                </select>
                <input className='input-buscador' name="MinPrice" placeholder="Desde" type="text">
                </input>
                <input className='input-buscador' name="MaxPrice" placeholder="Hasta" type="text">
                </input>
                <a class="button-buscador" href="">Buscar</a>
            </form>
            <a class="button-buscador" href="">Realizar una b√∫squeda avanzada</a>
        </div>
    );
}

